import React from 'react';
import styles from './navbar.module.scss';

const Navbar = () => (
    <div  className={styles.navbarContainer}>    
            <h1> Pablo Pose</h1>
            <h1> Actor y doblaje</h1>
    </div>
)

export default Navbar;
